const Test = () => {
  const { userEmail } = useContext(AccountContext);

  const getData = () => {
    drive().then(sheet());
  };

  const sheet = () => {
    fetch("/sheet/api")
      .then((res) => res.json())
      .then((data) => console.log(data));
  };

  const drive = () => {
    axios.post("http://localhost:3000/drive/id", userEmail).then(
      fetch("/drive/api")
        .then((res) => res.json())
        .then((res) => Object.assign({}, res.files[0]))
        .then((data) => {
          axios.post("/sheet/id", data);
        })
    );
  };

  useEffect(() => {
    getData();
  }, []);

  return <></>;
};

export default Test;
